import React from 'react'
import './Navbar.css'

function Navbar() {

    const changeTitle = () => {
        switch(window.location.pathname){
            case '/new-order':
                return 'New Order';
            case '/incoming':
                return 'Incoming Orders';
            case '/ready':
                return 'Ready Orders';
        }
    }

    let section = changeTitle() 

    return(
        <div className= "topbar">
            <h1>Burguer Queen / {section} </h1>
        </div>
    )
}

export default Navbar
